import React, { Component } from "react";
import request from "request";
import cheerio from 'cheerio';
const url = 'https://datalab.naver.com/keyword/realtimeList.naver?where=main';

class Silkum extends Component {
  render() {    
    const result = [];
    request({
      url : url,
      method : 'GET',
      headers : {
        'Accept-Charset' : 'UTF=8',
      'User-Agent':'Mozilla/5.0 (Windows NT 6.3; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.132 Safari/537.36'
      }
    }, function(err,res2,body) {
      const $ = cheerio.load(body);
      let select = $('span.item_title');
      select.each(function(i,elem) {
        result[i] = $(this).text();
      });
      result.join(',');
      let silkumlist = result.map((rank, i) => (<div key={i}>{rank}</div>));
      console.log(silkumlist)
    })

    return (
      <>

        12345
      </>
    );
  }
}

export default Silkum;
